import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import breakpoint from '../breakpoints';

const NewItem = (props) => {


  return (
    <ItemWrapper key={props.id} style={{ backgroundImage: `url(${props.image})`, backgroundPosition: 'center', backgroundSize: 'cover', position:'relative'}}>
        <div style={{width: '100%', height: '400px', position: 'relative', marginLeft: '15px'}}>
          <div style={{position: 'absolute', top: '270px', textAlign: 'left'}}>
            <h3>{props.description}</h3>
            <Link to={props.link}><button>{props.cta}</button></Link>
          </div>
        </div>
    </ItemWrapper>
  );
}

export default NewItem;

const ItemWrapper = styled.div`
  margin: 10px 0;

@media only screen and ${breakpoint.device.laptop} {
  //yellow background

}

@media only screen and ${breakpoint.device.desktop} {

}
`;
